import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import "./info.js";

function appContent() {
  return ( < div > < Header / >
    <
    Note name = {
      celebrity[0].name
    }
    image = {
      celebrity[0].image
    }
    tel = {
      celebrity[0].tel
    }
    email = {
      celebrity[0].email
    }
    /> <
    Footer / > < /div>);
  }

  export default appContent;
